import React, { Component } from 'react'
import Layout from '../components/layout.js'
import Link from 'next/link'


class Home extends Component {
    render() {
        return (
            <Layout>
                <h1>This is my home page Idiot!!</h1>
            </Layout>
        )
    }
}

export default Home;
